import com.advancedspark.spark.ml.image.ImageIO
import org.apache.spark.mllib.linalg.Vectors

val imagePathsRDD = sc.wholeTextFiles(inputImagesPath).map {
  case (path, content) => path.replace("file:", "")
}

val imagesAsPixelArray = imagePathsRDD.map(imagePath => {
  (imagePath, ImageIO.extractAndScalePixelArray(imagePath, scaledWidth, scaledHeight))
})

val imagesAsPixelVector = imagesAsPixelArray.map { 
  case (imagePath, pixelArray) => (imagePath, Vectors.dense(pixelArray))
}

val imagesAsPixelVectorDF = imagesAsPixelVector.toDF("imagePath", "pixelVector")

z.show(imagesAsPixelVectorDF.limit(10))
